How It's Made: The Fun Stuff

Technology Documentary hosted by Brooks T Moore and Lynne Adams, published by Discovery Channel in 2012 - English narration


Information
------------------------------

How It's Made: The Fun Stuff
Have you ever wondered how things are made? Find out how many of the everyday objects kids use become the fun things they are! From pin ball to paint, this program for children explains how everyday objects can be used to make something entirely new.
Includes 30 fun-filled kid-targeted segments!


